	add("diacetoxyscirpenol", "{\"term\":\"diacetoxyscirpenol\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mycotoxin from the group of type-A trichothecenes. It is a secondary metabolite product of fungi of the genus \u0027Fusarium\u0027 and may cause toxicosis in farm animals\", \"priority\":1}]}, \"synonyms\":{}}");

