	add("diadem", "{\"term\":\"diadem\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027diademe\u0027 from Latin \u0027diadēma\u0027 from Ancient greek (to 1453) \u0027διάδημα\u0027 (lang\u003dgrc) from \u0027διαδέω\u0027 (lang\u003dgrc)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An ornamental headband worn as a badge of royalty\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A crown\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Regal power; sovereignty; empire—considered as symbolized by the crown\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An arch rising from the rim of a crown (rarely also of a coronet), and uniting with others over its centre\", \"priority\":4}]}, \"synonyms\":{}}");

	add("diaeresis", "{\"term\":\"diaeresis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027διαίρεσις\u0027 (division, split) from \u0027διά\u0027 (apart) + \u0027αἱρέω\u0027 (i take)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A diacritic ( ¨ ) placed over a vowel letter (especially the second of two consecutive ones) indicating that it is sounded separately, usually forming a distinct syllable, as in the English words , and , the French and the Dutch\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The separation of a vowel, often a diphthong, into two distinct syllables\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A natural break in rhythm when a word ends at the end of a metrical foot, in a line of verse\", \"priority\":3}]}, \"synonyms\":{}}");

	add("diafiltration", "{\"term\":\"diafiltration\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|dia|filtration|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"filtration through a permeable membrane in order to remove medium- to large-size molecules\", \"priority\":1}]}, \"synonyms\":{}}");

	add("diagenesis", "{\"term\":\"diagenesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"All the chemical, physical, and biological changes sediment goes through during and after lithification, not including weathering or other surface changes\", \"priority\":1}]}, \"synonyms\":{}}");

