	add("diagnosis", "{\"term\":\"diagnosis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"{{PIE root|en|ǵneh₃}}From Latin {{m|la|diagnōsis}}, from Ancient greek (to 1453) \u0027διάγνωσις\u0027 from \u0027διαγιγνώσκειν\u0027 (to discern) from \u0027διά\u0027 (apart) + \u0027γιγνώσκειν\u0027 (to learn)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The identification of the nature and cause of an illness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The identification of the nature and cause of something (of any nature\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Compton Read\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The quick eye for effects, the clear \u0027\u0027diagnosis\u0027\u0027 of men\u0027s minds, and the love of epigram\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"J. Pay\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"My \u0027\u0027diagnosis\u0027\u0027 of his character proved correct\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A written description of a species or other taxon serving to distinguish that species from all others. Especially, a description written in Latin and published\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The repeated exposure, over decades, to most taxa here treated has resulted in repeated modifications of both \u0027\u0027diagnoses\u0027\u0027 and discussions, as initial ideas of the various taxa underwent—often repeated—conceptual modification\", \"priority\":8}]}, \"synonyms\":{}}");

	add("diagonalizability", "{\"term\":\"diagonalizability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The ability to be diagonalized\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027 January, Bernard Russo and James J. Tattersall, \u0026quot;Program of the Sessions: Washington, District of Columbia, January 5–8, 2009\u0026quot;, \u0027Notices of the American Mathematical Society\u0027, 56:1\u0026lt;sup\u0026gt;[http://www.ams.org/notices/200901/]\u0026lt;/sup\u0026gt;, page 158\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"10:30\u0026lt;small\u0026gt;AM\u0026lt;/small\u0026gt; (1060) \u0027Linear maps preserving \u0027\u0027diagonalizability\u0027\u0027 on the space of upper triangular matrices.\u0027 Preliminary report. A. A. Jafarian, University of New Haven\", \"priority\":3}]}, \"synonyms\":{}}");

	add("diagram", "{\"term\":\"diagram\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From French \u0027lang\u003dfr\u0027 from Latin \u0027diagramma\u0027 from Ancient greek (to 1453) \u0027διάγραμμα\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A plan, drawing, sketch or outline to show how something works, or show the relationships between the parts of a whole\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Electrical \u0027\u0027diagrams\u0027\u0027 show device interconnections\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A graph or chart\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A functor from an \u0027index category\u0027 to another category. The objects and morphisms of the index category need not have any internal substance, but rather merely outline the connective structure of at least some part of the diagram\u0027s codomain. If the index category is \u0027J\u0027 and the codomain is \u0027C\u0027, then the diagram is said to be \u0026quot;of type \u0027J\u0027 in \u0027C\u0027\u0026quot\", \"priority\":4}]}, \"synonyms\":{}}");

	add("diagrammatics", "{\"term\":\"diagrammatics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the use of diagrams\", \"priority\":1}]}, \"synonyms\":{}}");

	add("diakoptics", "{\"term\":\"diakoptics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From the Greek \u0027dia\u0027 (system) + \u0027koptic\u0027 (tear).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of breaking a problem down into components which can be solved independently before being joined back together to obtain a solution to the whole problem\", \"priority\":1}]}, \"synonyms\":{}}");

	add("dialane", "{\"term\":\"dialane\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The aluminium hydride Al\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;H\u0026lt;sub\u0026gt;6\u0026lt;/sub\u0026gt; that is a dimer of alane found only at low temperatures\", \"priority\":1}]}, \"synonyms\":{}}");

	add("dialect", "{\"term\":\"dialect\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) {{m|frm|dialecte}}, from Latin {{m|la|dialectos}}, {{m|la|dialectus}}, from Ancient greek (to 1453) {{m|grc|διάλεκτος||conversation, the language of a country or a place or a nation, the local idiom which derives from a dominant language}}, from {{m|grc|διαλέγομαι||I participate in a dialogue}}, from {{m|grc|διά||inter, through}} + {{m|grc|λέγω||I speak}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A variety of a language (specifically, often a spoken variety) that is characteristic of a particular area, community or group, often with relatively minor differences in vocabulary, style, spelling and pronunciation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A language is a \u0027\u0027dialect\u0027\u0027 with an army and a navy\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And in addition, many \u0027\u0027dialects\u0027\u0027 of English make no morphological distinction between Adjectives and Adverbs, and thus use Adjectives in contexts where the standard language requires \u0027-ly\u0027 Adverbs: compare\u0026lt;br\u0026gt; (81) (a) \u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp; Tex talks \u0027really quickly\u0027 [Adverb + Adverb]\u0026lt;br\u0026gt;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp; (b) \u0026amp;nbsp;\u0026amp;nbsp;%Tex talks \u0027real quick\u0027 [Adjective + Adjective\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A dialect of a language perceived as substandard and wrong\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1967\u0027\u0027, Roger W. Shuy, \u0027Discovering American dialects\u0027, National Council of Teachers of English, page 1\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Many even deny it and say something like this: \u0026quot;No, we don\u0027t speak a \u0027\u0027dialect\u0027\u0027 around here. \u0026lt;nowiki\u0026gt;[...]\u0026lt;/nowiki\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1975\u0027\u0027, \u0027Linguistic perspectives on black English\u0027, H. Carl, page 219\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Well, those children don\u0027t speak \u0027\u0027dialect\u0027\u0027, not in this school. Maybe in the public schools, but not here\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, H. Nigel Thomas, \u0027Spirits in the dark\u0027, Heinemann, page 11\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"lt;nowiki\u0026gt;[...]\u0026lt;/nowiki\u0026gt; on the second day, Miss Anderson gave the school a lecture on why it was wrong to speak \u0027\u0027dialect\u0027\u0027. She had ended by saying \u0026quot;Respectable people don\u0027t speak \u0027\u0027dialect\u0027\u0027.\u0026quot\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A or language\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A variant of a non-standardized programming language\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Home computers in the 1980s had many incompatible \u0027\u0027dialects\u0027\u0027 of BASIC\", \"priority\":13}]}, \"synonyms\":{}}");

	add("dialectic", "{\"term\":\"dialectic\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\"], \"text\":\"From Old french (842-ca. 1400) \u0027dialectique\u0027 from \u0027dialectica\u0027 from Ancient greek (to 1453) \u0027διαλεκτική\u0027 (the art of argument through interactive questioning and answering) from \u0027διαλεκτικός\u0027 (competent debater) from \u0027διαλέγομαι\u0027 (to participate in a dialogue) from \u0027διά\u0027 (through, across) + \u0027λέγω\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any formal system of reasoning that arrives at a truth by the exchange of logical arguments\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A contradiction of ideas that serves as the determining factor in their interaction\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This situation created the inner \u0027\u0027dialectic\u0027\u0027 of American history\", \"priority\":3}]}, \"synonyms\":{}}");

	add("dialectometry", "{\"term\":\"dialectometry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the regional distribution of dialects\", \"priority\":1}]}, \"synonyms\":{}}");

	add("dialer", "{\"term\":\"dialer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|dial|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person or device that dials, as using a telephone\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He treated his assistant as a voice-operated \u0027\u0027dialer\", \"priority\":2}]}, \"synonyms\":{}}");

	add("dialetheism", "{\"term\":\"dialetheism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Coined by Graham Priest and Richard Routley, from {{prefix|di-|lang\u003den}} Ancient greek (to 1453) \u0027ἀλήθεια\u0027 (truth) in 1981\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The idea that statements can be both true and false at the same time and in the same sense. The opposite of the law of noncontradiction\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Laurence Goldstein, \u0027Logic: key concepts in philosophy\u0027, page 158\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It] is important to point out that endorsing \u0027\u0027dialetheism\u0027\u0027 is not the same as rejecting logic or rational argumentation\", \"priority\":3}]}, \"synonyms\":{}}");

	add("dialog", "{\"term\":\"dialog\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"ancient greek (to 1453)\"], \"text\":\"From Middle english (1100-1500) \u0027dialog\u0027 (a literary talk, literary composition in dialog form; dialogus, the dialogues of pope gregory the great; a conversation) from Ancient greek (to 1453) \u0027διάλογος\u0027 (conversation, discourse) from \u0027διά\u0027 (through, inter) + \u0027λόγος\u0027 (speech, oration, discourse) from \u0027διαλέγομαι\u0027 (to converse) from \u0027διά\u0027 + \u0027λέγειν\u0027 (to speak)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A conversation or other form of discourse between two or more individuals\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In a dramatic or literary presentation, the verbal parts of the script or text; the verbalizations of the actors or characters\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A literary form, where the presentation resembles a conversation\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1475\u0027\u0027, \u0027Higden\u0027s Polychronicon\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Seynte Aldelme returnyde to Briteyne..makenge mony noble bookes ... of the rewles of feete metricalle, of metaplasmus, of \u0027\u0027dialog\u0027\u0027 metricalle\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A dialog box\", \"priority\":6}]}, \"synonyms\":{}}");

	add("dialogics", "{\"term\":\"dialogics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"dialogic writing and interactions generally\", \"priority\":1}]}, \"synonyms\":{}}");

	add("dialogue", "{\"term\":\"dialogue\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\"], \"text\":\"From Old french (842-ca. 1400) \u0027dialoge\u0027 (French \u0027dialogue\u0027 , from \u0027dialogus\u0027 from Ancient greek (to 1453) \u0027διάλογος\u0027 (conversation, discourse) from \u0027διά\u0027 (through, inter) + \u0027λόγος\u0027 (speech, oration, discourse) from \u0027διαλέγομαι\u0027 (to converse) from \u0027διά\u0027 + \u0027λέγειν\u0027 (to speak)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A conversation or other form of discourse between two or more individuals\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Bill and Melinda maintained a \u0027\u0027dialogue\u0027\u0027 via email over the course of their long-distance relationship\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Paul Harris, \u0027Lance Armstrong faces multi-million dollar legal challenges after confession\u0027 (in \u0027The Guardian\u0027, 19 January 2013)[http://www.guardian.co.uk/sport/2013/jan/19/lance-armstrong-legal-challenges-confession\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The hours of \u0027\u0027dialogue\u0027\u0027 with Winfrey, which culminated in a choked-up moment on Friday night as he discussed the impact of his cheating on his family, appear to have failed to give Armstrong the redemption that he craves\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In a dramatic or literary presentation, the verbal parts of the script or text; the verbalizations of the actors or characters\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The movie had great special effects, but the \u0027\u0027dialogue\u0027\u0027 was lackluster\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A literary form, where the presentation resembles a conversation\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A literary historian, she specialized in the \u0027\u0027dialogues\u0027\u0027 of ancient Greek philosophers\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A dialogue box\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Once the My Computer \u0027\u0027dialogue\u0027\u0027 opens, select Local Disk (C:), then right click and scroll down\", \"priority\":10}]}, \"synonyms\":{}}");

	add("dialoguist", "{\"term\":\"dialoguist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|dialogue|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who writes dialogue\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A scriptwriter skilled at writing dialogue\", \"priority\":2}]}, \"synonyms\":{}}");

	add("dialuminium", "{\"term\":\"dialuminium\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Two aluminium atoms in a molecule\", \"priority\":1}]}, \"synonyms\":{}}");

	add("dialysis", "{\"term\":\"dialysis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Dated in the late 16th Century {{C.E.}}; from Ancient greek (to 1453) \u0027διά\u0027 (inter” “through) and \u0027λύειν\u0027 ({{l/en) lang\u003dgrc}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A method of separating molecules or particles of different sizes by differential diffusion through a semipermeable membrane\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Haemodialysis\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dAn artificial kidney these days still means a refrigerator-sized \u0027\u0027dialysis\u0027\u0027 machine. Such devices mimic the way real kidneys cleanse blood and eject impurities and surplus water as urine\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The spelling out of alternatives, or presenting of either-or arguments that lead to a conclusion\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Asyndeton\", \"priority\":5}]}, \"synonyms\":{}}");

	add("dialyzer", "{\"term\":\"dialyzer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|dialyze|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The part of a hemodialysis machine that performs filtration by unequal diffusion through membrane\", \"priority\":1}]}, \"synonyms\":{}}");

	add("diamante", "{\"term\":\"diamante\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027diamanté\u0027 (adorned with diamonds)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an artificial diamond used as adornment, such as a rhinestone\", \"priority\":1}]}, \"synonyms\":{}}");

	add("diameter", "{\"term\":\"diameter\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027diametre\u0027 (French \u0027diamètre\u0027 , from Latin \u0027diametrus\u0027 from Ancient greek (to 1453) \u0027διάμετρος\u0027 (\u0027γραμμή\u0027 (\u0027diametros grammē\u0027, “line measuring across”), from \u0027διά\u0027 (across) + \u0027μέτρον\u0027 (measure)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any straight line between two points on the circumference of a circle that passes through the centre/center of the circle\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The length of such a line\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The maximum distance between any two points in a metric spac\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The maximum eccentricity over all vertices in a graph\", \"priority\":4}]}, \"synonyms\":{}}");

