	add("diana", "{\"term\":\"diana\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{unk.|en}} origin. Theories include relationships with Latin \u0027deus\u0027 (god) Latin \u0027dies\u0027 (day) and a (reconstructed) name \u0027\u0027 \u0026lt;ref\u0026gt;{{R:VDSchaar|year\u003d1994|hw\u003dDiana}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The daughter of Latona and Jupiter, and twin sister of Apollo; the goddess of the hunt, associated wild animals and the forest or wilderness, and an emblem of chastity; the Roman counterpart of Artemis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"So that not only this our craft is in danger to be set at nought; but also that the temple of the great goddess \u0027\u0027Diana\u0027\u0027 should be despised, and her magnificence should be destroyed, whom all Asia and all the world worshippeth\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Short for , a main belt asteroid\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1605\u0027\u0027 w:William William Camden, \u0027Remains Concerning Britain\u0027, John Russell Smith, 1870, page 56\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"But succeeding ages (little regarding S. Chrysosthome\u0027s admonition to the contrary) have recalled prophane names, so as now \u0027\u0027Diana\u0027\u0027, Cassandra, Hyppolytus, Venus, Lais, names of unhappy disaster are as rife, as ever they were in paganism\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027 w:James James Kirkup, \u0027Queens Have Died Young and Fair\u0027, P. Owen, ISBN 0720608864, page 94\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A wholesome British name like \u0027\u0027Diana\u0027\u0027, Anne, Margaret or Elizabeth impresses a judge much more than all your vulgar Marilyns, Donnas, Madonnas and Dawns\", \"priority\":7}]}, \"synonyms\":{}}");

