	add("dianetics", "{\"term\":\"dianetics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027διά\u0027 (through) + \u0027νοῦς\u0027 (mind)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A self-help system designed by which is chiefly employed today in Scientology\", \"priority\":1}]}, \"synonyms\":{}}");

