	add("diapason", "{\"term\":\"diapason\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Latin \u0027diapason\u0027 from Ancient greek (to 1453) \u0027διαπασων\u0027 that is \u0027διά\u0027 + \u0027πασων\u0027 (\u0027χορδων\u0027 ‘through all (notes)’.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the range or scope of something, especially of notes in a scale, or of a particular musical instrumen\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1934\u0027\u0027: the piano curving like a conch, corollas giving out \u0027\u0027diapasons\u0027\u0027 of light — Henry Miller, \u0027Tropic of Cancer\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1961\u0027\u0027: he could hear nothing except the rattle of the crickets and the swelling \u0027\u0027diapason\u0027\u0027 of the frogs — Graham Greene, \u0027A Burnt-Out Case\", \"priority\":3}]}, \"synonyms\":{}}");

	add("diaper", "{\"term\":\"diaper\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027dyapre\u0027 \u0027diaspre\u0027 from medieval Latin \u0027diaspra\u0027 \u0027diasprum\u0027 from \u0027δίασπρος\u0027 from \u0027δια-\u0027 (across) + \u0027ἄσπρος\u0027 (white)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A textile fabric having a diamond-shaped pattern formed by alternating directions of thread\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1890\u0027\u0027, \u0027The Picture of Dorian Gray\u0027, ch. XI\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The orphreys were woven in a \u0027\u0027diaper\u0027\u0027 of red and gold silk, and were starred with medallions of many saints and martyrs, among whom was St. Sebastian\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A towel or napkin made from such fabric\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Let one attend him with a silver basin, / Another bear the ewer, the third a \u0027\u0027diaper\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An absorbent garment worn by a baby, by a young child not yet toilet toilet trained, or by an older person who is incontinent; a nappy\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The diamond pattern associated with diaper textiles\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Surface decoration of any sort which consists of the constant repetition of one or more simple figures or units of design evenly spaced\", \"priority\":9}]}, \"synonyms\":{}}");

	add("diaperhood", "{\"term\":\"diaperhood\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|diaper|hood|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The period of time for which one wears a diaper as a child; babyhood\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1930\u0027\u0027, Isaac Goldberg, \u0027Tin Pan Alley\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;Baby\u0027s Eyes\u0026quot; ... \u0026quot;Mud-Pie Days\u0026quot; ... \u0026quot;Baby Hands\u0026quot; ... \u0026quot;Creep, Baby, Creep\u0026quot; ... \u0026quot;My Mamma Lives Up in the Sky\u0026quot; ... \u0026quot;My Mother\u0027s Kiss\u0026quot; ... It was the \u0027\u0027diaperhood\u0027\u0027 of the Alley — a Society for the Prevention of Cruelty to Children set to children\u0027s music\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, John Voelker, \u0027Trout Magic\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"all this despite the fact that I was born and raised in the same Peninsula and had been trout fishing avidly almost from \u0027\u0027diaperhood\", \"priority\":5}]}, \"synonyms\":{}}");

	add("diaphane", "{\"term\":\"diaphane\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\"], \"text\":\"Via Old french (842-ca. 1400) from \u0027diaphanus|lang\u003dla\u0027 () from Ancient greek (to 1453) \u0027sc\u003dpolytonic\u0027 from \u0027sc\u003dpolytonic|διά\u0027 (through) and \u0027sc\u003dpolytonic|φαίνω\u0027 (show)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"something transparent or diaphanou\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a woven silk stuff with transparent and colored figures\", \"priority\":2}]}, \"synonyms\":{}}");

